// Forms
function initializeForms() {
    const investmentForm = document.getElementById('investment-form');
    const contactForm = document.getElementById('contact-form');
    
    if (investmentForm) {
        investmentForm.addEventListener('submit', handleInvestmentForm);
    }
    
    if (contactForm) {
        contactForm.addEventListener('submit', handleContactForm);
    }
}

function handleInvestmentForm(e) {
    e.preventDefault();
    
    const formData = new FormData(e.target);
    const data = {
        name: formData.get('investor-name') || document.getElementById('investor-name').value,
        email: formData.get('investor-email') || document.getElementById('investor-email').value,
        phone: formData.get('investor-phone') || document.getElementById('investor-phone').value,
        type: formData.get('investor-type') || document.getElementById('investor-type').value,
        range: formData.get('investment-range') || document.getElementById('investment-range').value,
        message: formData.get('investor-message') || document.getElementById('investor-message').value
    };
    
    // Simulate form submission
    showNotification('Interesse enviado com sucesso! Entraremos em contato em breve.', 'success');
    e.target.reset();
    
    // In a real implementation, you would send this data to your backend
    console.log('Investment form data:', data);
}

function handleContactForm(e) {
    e.preventDefault();
    
    const formData = new FormData(e.target);
    const data = {
        name: formData.get('contact-name') || document.getElementById('contact-name').value,
        email: formData.get('contact-email') || document.getElementById('contact-email').value,
        subject: formData.get('contact-subject') || document.getElementById('contact-subject').value,
        message: formData.get('contact-message') || document.getElementById('contact-message').value
    };
    
    // Simulate form submission
    showNotification('Mensagem enviada com sucesso! Responderemos em breve.', 'success');
    e.target.reset();
    
    // In a real implementation, you would send this data to your backend
    console.log('Contact form data:', data);
}

